import{e as i}from"./app.98de23b3.js";import{_ as l}from"./plugin-vue_export-helper.21dcd24c.js";const e={},a=i('<h2 id="_1-\u7248\u672C\u63A7\u5236\u5668" tabindex="-1"><a class="header-anchor" href="#_1-\u7248\u672C\u63A7\u5236\u5668" aria-hidden="true">#</a> 1. \u7248\u672C\u63A7\u5236\u5668</h2><p>\u65E9\u4E9B\u5E74\uFF0C\u4E3B\u6D41\u7684\u7248\u672C\u63A7\u5236\u5668\u4E3B\u8981\u662Fsvn\u3001cvs\u7B49\uFF0C\u8FD9\u4E9B\u7248\u672C\u63A7\u5236\u5668\u6709\u5BF9\u5E94\u7684\u64CD\u4F5C\u9875\u9762\uFF0C\u4F7F\u7528\u65B9\u4FBF\u5FEB\u6377\uFF0C\u4F46\u662F\u6709\u4E00\u4E2A\u901A\u75C5\uFF0C\u5C31\u662F\u5728\u8FDB\u884C\u591A\u4EBA\u534F\u540C\u5DE5\u4F5C\u65F6\uFF0C\u56E2\u961F\u6210\u5458\u4E4B\u95F4\u7684\u5F71\u54CD\u5F88\u5927\uFF0C\u6BD4\u5982\u8BF4\u5728\u56E2\u961F\u534F\u540C\u5DE5\u4F5C\u8FC7\u7A0B\u4E2D\uFF0C\u5982\u679C\u6709\u4E00\u4E2A\u4EBA\u5FD8\u8BB0\u66F4\u65B0\u4EE3\u7801\u540E\u76F4\u63A5\u63D0\u4EA4\u4EE3\u7801\uFF0C\u5C31\u4F1A\u9020\u6210\u5176\u4ED6\u4EBA\u7684\u4EE3\u7801\u4E22\u5931\u7684\u95EE\u9898\u3002\u8FD9\u4E2A\u95EE\u9898\u7684\u51FA\u73B0\u4E3B\u8981\u662F\u56E0\u4E3Asvn\u3001cvs\u7B49\u7248\u672C\u63A7\u5236\u5668\u4E3B\u8981\u662F\u5BF9\u6574\u4E2A\u4ED3\u5E93\u505A\u4E00\u4E2A\u955C\u50CF\u5907\u4EFD\u7684\u539F\u56E0\uFF0C\u800C\u8FD1\u4E9B\u5E74\uFF0Cgit\u8D8A\u6765\u8D8A\u706B\uFF0C\u4E00\u65B9\u9762\u56E0\u4E3A\u5B83\u4E0E\u5176\u4ED6\u5F00\u6E90\u5DE5\u5177\u7684\u534F\u540C\u5DE5\u4F5C\u7684\u6210\u529F\u6848\u4F8B\uFF0C\u53E6\u4E00\u65B9\u9762\u8FD8\u56E0\u4E3A\u5B83\u7684\u5206\u652F\u7BA1\u7406\u673A\u5236\u3002</p><p>\u8FD9\u91CC\u6211\u4EEC\u53EA\u8BF4Git\u4F5C\u4E3A\u7248\u672C\u63A7\u5236\u7684\u5B9E\u8DF5\u65B9\u5F0F\u3002</p><h2 id="_2-\u4E24\u79CD\u7248\u672C\u63A7\u5236\u65B9\u5F0F" tabindex="-1"><a class="header-anchor" href="#_2-\u4E24\u79CD\u7248\u672C\u63A7\u5236\u65B9\u5F0F" aria-hidden="true">#</a> 2. \u4E24\u79CD\u7248\u672C\u63A7\u5236\u65B9\u5F0F</h2><p>\u5728git\u7684\u4F7F\u7528\u8FC7\u7A0B\u4E2D\uFF0C\u5047\u5982\u56E2\u961F\u4E2D\u6709\u591A\u4EBA\u534F\u4F5C\uFF0C\u90A3\u4E48\u5C31\u6D89\u53CA\u5230\u4E00\u4E2A\u7248\u672C\u7BA1\u7406\u7684\u8FC7\u7A0B\u3002\u76EE\u524D\uFF0C\u4E1A\u5185\u6709\u4E24\u79CD\u7248\u672C\u534F\u540C\u8FC7\u7A0B\uFF0C\u4E00\u79CD\u662F\u6BCF\u4E00\u4E2A\u5F00\u53D1\u4EBA\u5458\u62E5\u6709\u81EA\u5DF1\u7684\u5F00\u53D1\u5206\u652F\uFF0C\u53E6\u4E00\u79CD\u662F\u6BCF\u4E00\u4E2A\u6295\u4EA7\u7248\u672C\u6709\u4E00\u4E2A\u5F00\u53D1\u5206\u652F\uFF0C\u5728\u5B8C\u6210\u5F00\u53D1\u6D4B\u8BD5\u8FC7\u7A0B\u540E\uFF0C\u628A\u4EE3\u7801\u96C6\u4E2D\u5408\u5E76\u5230\u6295\u4EA7\u5206\u652F\u4E0A\u8FDB\u884C\u6253\u5305\u90E8\u7F72\u5373\u53EF\u3002\u540E\u7EED\u8FED\u4EE3\u8FC7\u7A0B\uFF0C\u518D\u4ECE\u6295\u4EA7\u5206\u652F\u4E0A\u5207\u51FA\u5F00\u53D1\u5206\u652F\u5B8C\u6210\u8FED\u4EE3\u6216\u8005\u628A\u6295\u4EA7\u5206\u652F\u7684\u4EE3\u7801\u5408\u5E76\u5230\u5F00\u53D1\u5206\u652F\u5373\u53EF\u3002</p><p>\u9488\u5BF9\u7B2C\u4E00\u79CD\uFF0C\u6BCF\u4E00\u4E2A\u5F00\u53D1\u4EBA\u5458\u90FD\u6709\u4E00\u4E2A\u5355\u72EC\u5C5E\u4E8E\u81EA\u5DF1\u7684\u5206\u652F\u3002\u8FD9\u79CD\u5B9E\u8DF5\u65B9\u5F0F\u5927\u6982\u662F\u8FD9\u6837\u7684\uFF1A</p><ol><li>\u6700\u5F00\u59CB\u65F6\uFF0Ca\u4ECE\u6295\u4EA7\u5206\u652F\u4E0A\u521B\u5EFA\u5C5E\u4E8Ea\u7684\u7248\u672C\u5206\u652F\uFF1B</li><li>b\u4ECE\u6295\u4EA7\u5206\u652F\u4E0A\u521B\u5EFA\u5C5E\u4E8Eb\u7684\u7248\u672C\u5206\u652F\uFF1B</li><li>a\u3001b\u5F00\u53D1\u5B8C\u6210\u4E4B\u540E\uFF0C\u4F9D\u6B21\u767B\u5F55\u53D1\u5E03\u5230\u6D4B\u8BD5\u73AF\u5883\u5B8C\u6210\u5355\u5143\u6D4B\u8BD5\uFF0C\u8FD9\u4E2A\u8FC7\u7A0B\u4E2D\u6D4B\u8BD5\u73AF\u5883\u9700\u8981\u4E0D\u65AD\u5207\u6362\u5206\u652F\uFF0C\u6D4B\u8BD5\u73AF\u5883\u4F1A\u5F88\u4E0D\u7A33\u5B9A\uFF0C\u6D4B\u8BD5\u4EBA\u5458\u4E5F\u65E0\u6CD5\u7ACB\u523B\u611F\u77E5\u5230a\u548Cb\u4E24\u4E2A\u5206\u652F\u5408\u5E76\u540E\u7684\u6548\u679C\uFF1B</li><li>\u5B8C\u6210\u5355\u5143\u6D4B\u8BD5\u540E\uFF0Ca\u548Cb\u4F9D\u6B21\u5408\u5E76\u5230\u6295\u4EA7\u5206\u652F\u4E0A\uFF1B</li><li>\u7248\u672C\u7BA1\u7406\u5458\u6216\u4EE3\u7801\u5BA1\u6838\u4EBA\u5458\u5BF9a\u548Cb\u7684\u4EE3\u7801\u8FDB\u884Creview\u540E\u5408\u5E76\u5206\u652F\uFF1B</li><li>\u5408\u5E76\u5B8C\u6210\u540E\u518D\u6B21\u90E8\u7F72\u5230\u6D4B\u8BD5\u73AF\u5883\u4E0A\uFF0C\u6B64\u65F6\u6D4B\u8BD5\u73AF\u5883\u4E0A\u65E2\u6709a\u7684\u529F\u80FD\uFF0C\u53C8\u6709b\u7684\u529F\u80FD\uFF0C\u6D4B\u8BD5\u4EBA\u5458\u5B8C\u6210\u7CFB\u7EDF\u6D4B\u8BD5\u540E\u6295\u4EA7\uFF1B</li><li>\u5047\u5982\u5176\u4E2D\u4E00\u4E2A\u5F00\u53D1\u4EBA\u5458\u7684\u4EE3\u7801\u5728\u751F\u4EA7\u73AF\u5883\u4E2D\u51FA\u73B0\u4E86\u95EE\u9898\uFF0C\u5C31\u9700\u8981\u56DE\u6EDA\uFF0C\u53EA\u9700\u8981\u56DE\u6EDA\u6709\u95EE\u9898\u7684\u5F00\u53D1\u4EBA\u5458\u7684\u4EE3\u7801\u5373\u53EF\uFF1B</li><li>\u5047\u5982\u6CA1\u6709\u95EE\u9898\uFF0C\u4E0B\u4E2A\u7248\u672C\u8FED\u4EE3\u8FC7\u7A0B\uFF0C\u5C31\u9700\u8981a\u548Cb\u90FD\u628A\u8FD9\u6B21\u6295\u4EA7\u5206\u652F\u4E0A\u7684\u4EE3\u7801\u5408\u5E76\u5230\u81EA\u5DF1\u7684\u5206\u652F\u4E0A\uFF0C\u7136\u540E\u518D\u8FDB\u884C\u8FED\u4EE3\u5F00\u53D1\uFF1B</li></ol><ul><li>\u4F18\u70B9\uFF1A <ul><li><code>\u89E3\u51B3\u529F\u80FD\u70B9\u4E0D\u540C\u65F6\u6295\u4EA7\u95EE\u9898</code>\uFF1A\u5982\u679C\u4E0D\u540C\u5F00\u53D1\u4EBA\u5458\u7684\u9700\u6C42\uFF0C\u53EF\u80FD\u4E0D\u5728\u540C\u4E00\u4E2A\u65F6\u95F4\u70B9\u4E0A\u8FDB\u884C\u6295\u4EA7\uFF0C\u91C7\u7528\u8FD9\u79CD\u65B9\u5F0F\uFF0C\u5C31\u53EF\u4EE5\u8BA9a\u5F00\u53D1\u4EBA\u5458\u5148\u5408\u5E76\u5230\u6295\u4EA7\u5206\u652F\u8FDB\u884C\u6295\u4EA7\uFF0C\u6D4B\u8BD5\u5B8Cb\u5F00\u53D1\u4EBA\u5458\u7684\u4EE3\u7801\u540E\u518D\u5408\u5E76\u8FDB\u884C\u6295\u4EA7\uFF1B</li><li><code>\u89E3\u51B3\u56DE\u6EDA\u95EE\u9898</code>\uFF1A \u6709\u65F6\u5019\u4EE3\u7801\u9700\u8981\u8FDB\u884C\u56DE\u6EDA\uFF0C\u8FD9\u79CD\u65B9\u5F0F\u53EF\u4EE5\u53EA\u56DE\u6EDA\u6709\u95EE\u9898\u7684\u5F00\u53D1\u4EBA\u5458\u7684\u4EE3\u7801\u5206\u652F\u5373\u53EF\uFF0C\u4E0D\u9700\u8981\u56DE\u6EDA\u5168\u90E8\u7684\u5F00\u53D1\u4EBA\u5458\u7684\u4EE3\u7801\uFF1B</li><li><code>\u9002\u7528\u7248\u672C\u5468\u671F\u4E0D\u7A33\u5B9A\u7684\u56E2\u961F</code>\uFF1A \u5141\u8BB8\u4E00\u4E2A\u7248\u672C\u5185\uFF0C\u67D0\u4E00\u4E2A\u529F\u80FD\u70B9\u5355\u72EC\u4E0A\u7EBF\uFF1B</li></ul></li><li>\u7F3A\u70B9\uFF1A <ul><li><code>\u6D4B\u8BD5\u73AF\u5883\u62E5\u5835</code>\uFF1A\u7531\u4E8E\u6D4B\u8BD5\u65F6\u4F9D\u8D56\u6D4B\u8BD5\u73AF\u5883\uFF0C\u6BCF\u4E00\u4E2A\u5F00\u53D1\u4EBA\u5458\u5F00\u53D1\u5B8C\u6210\u540E\uFF0C\u90FD\u9700\u8981\u4F7F\u7528\u6D4B\u8BD5\u73AF\u5883\uFF0C\u8FD9\u5C31\u9020\u6210\u4E86\u6D4B\u8BD5\u73AF\u5883\u62E5\u5835\u7684\u73B0\u8C61\uFF0C\u751A\u81F3\u4F1A\u51FA\u73B0\u7B49\u5F85\u7684\u73B0\u8C61\uFF1B</li><li><code>\u6D4B\u8BD5\u4EBA\u5458\u4EFB\u52A1\u52A0\u91CD</code>\uFF1A\u5982\u679C\u987A\u5229\u5B8C\u6210\u5355\u5143\u6D4B\u8BD5\uFF0C\u90A3\u4E48\u8FD8\u9700\u8981\u5BF9\u591A\u4E2A\u5F00\u53D1\u4EBA\u5458\u7684\u7248\u672C\u5206\u652F\u8FDB\u884C\u5408\u5E76\uFF0C\u7136\u540E\u90E8\u7F72\u5230\u6D4B\u8BD5\u73AF\u5883\u4E0A\u8FDB\u884C\u7CFB\u7EDF\u6D4B\u8BD5\uFF0C\u6D4B\u8BD5\u4EBA\u5458\u7684\u5DE5\u4F5C\u5185\u5BB9\u52A0\u5927\uFF0C\u5373\u5148\u8FDB\u884C\u6BCF\u4E00\u4E2A\u5F00\u53D1\u4EBA\u5458\u5206\u652F\u7684\u5355\u5143\u6D4B\u8BD5\uFF0C\u7136\u540E\u518D\u8FDB\u884C\u591A\u4E2A\u5F00\u53D1\u4EBA\u5458\u7684\u5206\u652F\u7684\u5408\u5E76\u540E\u7684\u7CFB\u7EDF\u6D4B\u8BD5\uFF1B</li></ul></li></ul><p>\u9488\u5BF9\u7B2C\u4E8C\u79CD\uFF0C\u6BCF\u4E00\u4E2A\u6295\u4EA7\u7248\u672C\u90FD\u8BBE\u7F6E\u4E00\u4E2A\u5F00\u53D1\u5206\u652F\u3002\u5B83\u7684\u5B9E\u8DF5\u65B9\u5F0F\u5927\u6982\u662F\u8FD9\u6837\u7684\uFF1A</p><ol><li>\u6700\u5F00\u59CB\u65F6\uFF0C\u7248\u672C\u7BA1\u7406\u5458\uFF08\u6216\u8005\u56E2\u961F\u67D0\u4E00\u4E2A\u6210\u5458\uFF09\u5728\u6295\u4EA7\u5206\u652F\u4E0A\u521B\u5EFA\u51FA\u4E00\u4E2A\u5F00\u53D1\u5206\u652F\uFF1B</li><li>a\u548Cb\u90FD\u68C0\u51FA\u8FD9\u4E2A\u5F00\u53D1\u5206\u652F\uFF0C\u5E76\u5728\u8FD9\u4E2A\u5206\u652F\u4E0A\u5B8C\u6210\u4EE3\u7801\u5F00\u53D1\uFF1B</li><li>\u6D4B\u8BD5\u73AF\u5883\u4E0A\u4E5F\u53EA\u9700\u8981\u90E8\u7F72\u8FD9\u4E2A\u5206\u652F\u5C31\u884C\u4E86\uFF0C\u6D4B\u8BD5\u4EBA\u5458\u53EA\u9700\u8981\u6D4B\u8BD5\u8FD9\u4E2A\u5206\u652F\u7684\u4EE3\u7801\u5373\u53EF\uFF1B</li><li>\u6240\u6709\u7684\u6D4B\u8BD5\u5B8C\u6210\u540E\uFF0C\u6D4B\u8BD5\u4EBA\u5458\u5B8C\u6210\u56DE\u5F52\u6D4B\u8BD5\u540E\uFF0C\u518D\u5408\u5E76\u5230\u6295\u4EA7\u5206\u652F\u8FDB\u884C\u6295\u4EA7\u53D1\u5E03\uFF1B</li><li>\u5047\u5982\u4E00\u4E2A\u5F00\u53D1\u4EBA\u5458\u7684\u4EE3\u7801\u5728\u751F\u4EA7\u73AF\u5883\u4E2D\u51FA\u73B0\u4E86\u95EE\u9898\u9700\u8981\u56DE\u6EDA\u4EE3\u7801\uFF0C\u90A3\u4E48\u8FD9\u4E2A\u7248\u672C\u5206\u652F\u4E2D\u7684\u4EE3\u7801\u5C31\u9700\u8981\u5168\u90E8\u56DE\u6EDA\uFF1B</li><li>\u5047\u5982\u6CA1\u6709\u95EE\u9898\uFF0C\u90A3\u4E48\u4E0B\u6B21\u7248\u672C\u4EBA\u5458\u76F4\u63A5\u5728\u65B0\u7684\u6295\u4EA7\u5206\u652F\u4E0A\u5207\u51FA\u65B0\u7684\u5F00\u53D1\u5206\u652F\u5373\u53EF\uFF1B</li></ol><ul><li>\u4F18\u70B9\uFF1A <ul><li><code>\u6D4B\u8BD5\u73AF\u5883\u4E0D\u4F1A\u62E5\u5835</code>\uFF1A \u7531\u4E8E\u5F00\u53D1\u5206\u652F\u4E0A\u65E2\u6709a\u7684\u4EE3\u7801\uFF0C\u53C8\u6709b\u7684\u4EE3\u7801\uFF0C\u6240\u4EE5\u540C\u4E00\u4E2A\u7248\u672C\u8FC7\u7A0B\u4E2D\uFF0C\u4E0D\u4F1A\u51FA\u73B0a\u548Cb\u62E5\u5835\u7684\u95EE\u9898\uFF1B</li><li><code>\u80FD\u770B\u5230\u4E00\u4E2A\u7248\u672C\u5206\u652F\u4E2D\u4E0D\u540C\u529F\u80FD\u7684\u96C6\u6210\u6D4B\u8BD5\u6548\u679C</code>\uFF1A</li><li><code>\u8FED\u4EE3\u5468\u671F\u8F83\u7A33\u5B9A</code>\uFF1A \u8981\u6C42\u4E00\u4E2A\u8FED\u4EE3\u5468\u671F\u5185\uFF0C\u6240\u6709\u7684\u529F\u80FD\u5FC5\u987B\u8981\u8981\u4E48\u90FD\u4E0A\u7EBF\uFF0C\u8981\u4E48\u90FD\u4E0D\u4E0A\u7EBF\uFF1B\u6CA1\u6709\u8BF4\u53EF\u4EE5\u4E00\u4E2A\u529F\u80FD\u70B9\u4E0A\u7EBF\uFF0C\u4E00\u4E2A\u9057\u7559\u5230\u4E0B\u4E2A\u8FED\u4EE3\u7684\u60C5\u51B5\uFF1B</li></ul></li><li>\u7F3A\u70B9\uFF1A <ul><li><code>\u56DE\u6EDA\u8303\u56F4\u8FC7\u5927</code>\uFF1A \u5047\u5982\u67D0\u4E00\u4E2A\u5F00\u53D1\u4EBA\u5458\u7684\u4EE3\u7801\u6295\u4EA7\u540E\u6709\u95EE\u9898\uFF0C\u9700\u8981\u56DE\u6EDA\uFF0C\u90A3\u4E48\u5C31\u9700\u8981\u628A\u6574\u4E2A\u7248\u672C\u5185\u7684\u6240\u6709\u4EBA\u5458\u7684\u4EE3\u7801\u90FD\u9700\u8981\u56DE\u6EDA\uFF1B</li><li><code>\u53EF\u80FD\u4F1A\u9020\u6210\u5F00\u53D1\u4EBA\u5458\u95F2\u7684\u95F2\uFF0C\u5FD9\u7684\u5FD9</code>\uFF1A \u5728\u4E00\u4E2A\u7248\u672C\u5468\u671F\u5185\uFF0C\u5047\u5982\u4E00\u4E2A\u5F00\u53D1\u4EBA\u5458\u6548\u7387\u5F88\u9AD8\uFF0C\u53EF\u80FD\u5F88\u5FEB\u5C31\u5B8C\u6210\u4EBA\u5458\uFF0C\u800C\u53E6\u5916\u4E00\u4E2A\u5F00\u53D1\u4EBA\u5458\u7684\u6548\u7387\u5F88\u4F4E\uFF0C\u9700\u8981\u5230\u7248\u672C\u5468\u671F\u6700\u540E\u4E00\u5929\u624D\u5B8C\u6210\uFF0C\u8FD9\u5C31\u9020\u6210\u5F00\u53D1\u4EBA\u5458\u95F2\u7684\u95F2\u5FD9\u7684\u5FD9\u7684\u540E\u679C\uFF1B</li></ul></li></ul><h2 id="_3-\u9009\u62E9\u4F9D\u636E" tabindex="-1"><a class="header-anchor" href="#_3-\u9009\u62E9\u4F9D\u636E" aria-hidden="true">#</a> 3. \u9009\u62E9\u4F9D\u636E</h2><p>\u8FD9\u4E24\u79CD\u65B9\u5F0F\u5404\u6709\u5343\u79CB\uFF0C\u5F00\u53D1\u56E2\u961F\u5177\u4F53\u9009\u62E9\u54EA\u79CD\u63A7\u5236\u65B9\u5F0F\uFF0C\u8981\u6839\u636E\u5177\u4F53\u60C5\u51B5\u5177\u4F53\u5206\u6790\u3002\u5206\u6790\u548C\u9009\u62E9\u7684\u6807\u51C6\u53EF\u80FD\u6709\u4EE5\u4E0B\u51E0\u70B9\uFF1A</p><ol><li>\u56E2\u961F\u89C4\u6A21\u7684\u5927\u5C0F\uFF1A \u5982\u679C\u56E2\u961F\u89C4\u6A21\u8F83\u5927\uFF0C\u4E00\u4E2A\u7248\u672C\u7684\u529F\u80FD\u70B9\u8F83\u591A\uFF0C\u800C\u56E2\u961F\u5206\u6210\u591A\u4E2A\u5C0F\u7EC4\u5206\u522B\u8D1F\u8D23\u4E0D\u540C\u7684\u529F\u80FD\u70B9\uFF0C\u90A3\u4E48\u63A8\u8350\u4F7F\u7528\u7B2C\u4E8C\u79CD\u65B9\u5F0F\uFF0C\u56E0\u4E3A\u8FD9\u79CD\u65B9\u5F0F\u53EF\u4EE5\u4E3A\u662F\u6BCF\u4E00\u4E2A\u56E2\u961F\u521B\u5EFA\u4E00\u4E2A\u5F00\u53D1\u5206\u652F\uFF0C\u4E00\u4E2A\u6295\u4EA7\u7248\u672C\u5185\u6709\u591A\u4E2A\u4E0D\u540C\u5F00\u53D1\u5206\u652F\uFF0C\u8FD9\u79CD\u6A21\u578B\u5C31\u4F18\u70B9\u7C7B\u4F3C\u4E8E\u7B2C\u4E00\u79CD\u4E86\uFF0C\u53EA\u4E0D\u8FC7\u662F\u4E3A\u6BCF\u4E00\u4E2A\u56E2\u961F\u5206\u914D\u4E00\u4E2A\u4EE3\u7801\u5206\u652F\uFF1B</li><li>\u7CFB\u7EDF\u7684\u67B6\u6784\u6A21\u578B\uFF1A \u5047\u5982\u7CFB\u7EDF\u7684\u67B6\u6784\u6A21\u578B\u662F\u4E00\u79CD\u8026\u5408\u5EA6\u8F83\u4F4E\u7684\u7CFB\u7EDF\u67B6\u6784\uFF0C\u90A3\u4E48\u7B2C\u4E00\u79CD\u65B9\u5F0F\u4F1A\u66F4\u9002\u5408\u4E00\u4E9B\uFF0C\u56E0\u4E3A\u7B2C\u4E00\u79CD\u6A21\u5F0F\u66F4\u5408\u9002\u5355\u6253\u72EC\u6597\uFF1B\u5047\u5982\u67B6\u6784\u6A21\u578B\u8F83\u4E3A\u8026\u5408\uFF0C\u90A3\u4E48\u7B2C\u4E8C\u79CD\u53EF\u80FD\u4F1A\u66F4\u9002\u5408\u4E00\u4E9B\uFF0C\u56E0\u4E3A\u9700\u8981\u628A\u96C6\u6210\u6D4B\u8BD5\u7684\u6B65\u9AA4\u63D0\u5230\u524D\u9762\uFF1B</li><li>\u6D4B\u8BD5\u8D44\u6E90\u7684\u591A\u5C11\uFF1A \u4EE5\u5F00\u53D1\u4EBA\u5458\u4E0A\u6D4B\u8BD5\u73AF\u5883\u65F6\u4E0D\u62E5\u5835\u548C\u6D4B\u8BD5\u4EBA\u5458\u4E0D\u9700\u8981\u9891\u7E41\u5207\u6362\u5206\u652F\u4E3A\u4E3B\uFF0C\u5047\u5982\u5728\u6709\u9650\u7684\u6D4B\u8BD5\u8D44\u6E90\u524D\u63D0\u4E0B\uFF0C\u53D1\u751F\u4E86\u62E5\u5835\uFF0C\u90A3\u4E48\u5C31\u5E94\u8BE5\u5C3D\u91CF\u907F\u514D\u4F7F\u7528\u7B2C\u4E00\u79CD\u65B9\u5F0F\uFF1B</li><li>\u7248\u672C\u5468\u671F\u7684\u7A33\u5B9A\u4E0E\u5426\uFF1A \u5047\u8BBE\u7248\u672C\u5468\u671F\u786E\u5B9A\u540E\u5141\u8BB8\u7248\u672C\u5468\u671F\u5185\uFF0C\u90E8\u5206\u529F\u80FD\u5148\u4E0A\u7EBF\uFF0C\u90E8\u5206\u529F\u80FD\u9057\u7559\u5230\u4E0B\u4E2A\u7248\u672C\u4E0A\u7EBF\uFF0C\u90A3\u4E48\u53EF\u4EE5\u9009\u62E9\u7B2C\u4E00\u79CD\u65B9\u5F0F\uFF1B\u5047\u8BBE\u7248\u672C\u5468\u671F\u786E\u5B9A\u540E\uFF0C\u6240\u6709\u529F\u80FD\u5FC5\u987B\u5168\u90E8\u540C\u4E00\u65F6\u95F4\u4E0A\u7EBF\uFF0C\u90A3\u4E48\u5C31\u53EF\u4EE5\u9009\u62E9\u7B2C\u4E8C\u79CD\u65B9\u5F0F\uFF1B</li><li>\u4EE3\u7801\u8BC4\u5BA1\u673A\u5236\uFF1A \u867D\u7136gitlab\u53EF\u4EE5\u8BA9\u6211\u4EEC\u5408\u5E76\u4EE3\u7801\u7684\u65F6\u5019\u5B8C\u6210\u4EE3\u7801\u8BC4\u5BA1\uFF0C\u4F46\u662F\u5728\u9009\u62E9\u8FD9\u4E24\u79CD\u65B9\u5F0F\u7684\u540C\u65F6\uFF0C\u4E5F\u9700\u8981\u8003\u8651\u4EE3\u7801\u8BC4\u5BA1\u7684\u65F6\u673A\u548C\u65B9\u5F0F\uFF0C\u5982gitlab\u4E0A\u53EA\u8981\u53D1\u8D77\u4E86\u5408\u5E76\u8BF7\u6C42\uFF0C\u7248\u672C\u7BA1\u7406\u4EBA\u5458\u5C31\u8FDB\u884C\u5408\u5E76\uFF0C\u4EE3\u7801\u8BC4\u5BA1\u5C31\u653E\u5230\u7EBF\u4E0B\uFF0C\u8BC4\u5BA1\u901A\u8FC7\u4E4B\u540E\u624D\u8FDB\u884C\u63D0\u4EA4\uFF1B\u6216\u8005\u5728\u53D1\u8D77\u5408\u5E76\u8BF7\u6C42\u65F6\u5C31\u8FDB\u884C\u4EE3\u7801\u8BC4\u5BA1\uFF0C\u5982\u679C\u4EE3\u7801\u8BC4\u5BA1\u901A\u8FC7\uFF0C\u624D\u5141\u8BB8\u8FDB\u884C\u5408\u5E76\uFF1B</li></ol><h2 id="_4-\u603B\u7ED3" tabindex="-1"><a class="header-anchor" href="#_4-\u603B\u7ED3" aria-hidden="true">#</a> 4. \u603B\u7ED3</h2><p>\u7B2C\u4E00\u79CD\u65B9\u5F0F\u7684\u9002\u7528\u573A\u666F\uFF1A\u56E2\u961F\u89C4\u6A21\u8F83\u5C0F\uFF0C\u5F00\u53D1\u4EBA\u5458\u9002\u5408\u5355\u6253\u72EC\u6597\uFF0C\u7248\u672C\u5468\u671F\u8981\u6C42\u4E0D\u4E25\u683C\uFF0C\u4EE3\u7801\u8BC4\u5BA1\u4E0D\u591F\u89C4\u8303\u7B49\u3002\u55EF\uFF0C\u662F\u7684\uFF0C\u5C0F\u516C\u53F8\u7684\u6700\u4F73\u5B9E\u8DF5\u65B9\u5F0F\u3002</p><p>\u7B2C\u4E8C\u79CD\u65B9\u5F0F\u7684\u9002\u7528\u573A\u666F\uFF1A \u56E2\u961F\u89C4\u6A21\u8F83\u5927\uFF0C\u5F00\u53D1\u4EBA\u5458\u5408\u4F5C\u5BC6\u5207\uFF0C\u7248\u672C\u5468\u671F\u8981\u6C42\u4E25\u683C\uFF0C\u4EE3\u7801\u8BC4\u5BA1\u89C4\u8303\u7B49\u3002\u5BF9\uFF0C\u96C6\u56E2\u519B\u4F5C\u6218\u7684\u6700\u4F73\u5B9E\u8DF5\u65B9\u5F0F\u3002</p>',17);function o(d,c){return a}var h=l(e,[["render",o],["__file","versioncontrol.html.vue"]]);export{h as default};
